import React from 'react';
import {Link, Outlet} from 'react-router-dom';
import './Welcome.css';

const Welcome = () => {
    return (
        <div class="div">
            <h1 class="h1"><b>Welcome to <span class="highlight">SpotiForums</span></b></h1>
            <div class="div2">
                <Link to="/register">
                    <button type="button" class="button1"><b>Register</b></button>
                </Link>
                <Link to="/login">
                    <button type="button" class="button1"><b>Log-In</b></button>
                </Link>
            </div>
            <Outlet />
        </div>
    )
};

export default Welcome;
